:42','2021-10-30 06:50:41'),(14,'payment_notification_tpl_active','on','email','2021-10-25 11:46:42','2021-10-26 12:51:44'),(15,'payment_notification_tpl_subject','{{website_name}} - an amount has been deposited into your account','email','2021-10-25 11:46:42','2021-10-26 13:06:53'),(16,'payment_notification_tpl','<p>Hello <strong>{{firstname}},</strong></p><p>An amount of <strong>{{amount}} {{currency}}</strong> via&nbsp; <strong>{{method_name}}</strong> has been deposited into your account.</p><p>-------------------------------</p><p><strong>Details of your Deposit :</strong></p><p>Amount : {{amount}} {{currency}}</p><p>Paid via :&nbsp; {{method_name}}</p><p>Transaction Number : {{transaction_number}}</p><p>Your current Balance is <strong>{{balance}} {{currency}}</strong></p><p>&nbsp;</p>','email','2021-10-25 11:46:42','2021-10-26 13:27:41'),(17,'order_status_tpl_active','on','email','2021-10-25 11:46:42','2021-11-22 11:19:31'),(18,'order_status_tpl_subject','{{website_name}} - Your order status','email','2021-10-25 11:46:42','2021-10-27 07:37:07'),(19,'order_status_tpl','<p>Hello <strong>{{firstname}},</strong></p><p>Your order for <strong>{{service_name}}</strong> is now <strong>{{status}}</strong> .</p><p>-------------------------------</p><p><strong>Order Details :</strong></p><p>Order ID : {{order_ID}}</p><p>Service Name : {{service_name}}&nbsp;</p><p>Service Category : {{service_category}}</p><p>Price : &nbsp;{{price}} {{currency}}</p><p>Your Balance : &nbsp;{{balance}} {{currency}}</p>','email','2021-10-25 11:46:42','2021-10-27 07:21:34'),(20,'website_logo','logo.png','apparence','2021-10-25 11:58:25','2021-10-25 11:58:25'),(23,'password_recovery_tpl_active','on','email','2021-10-30 14:07:16','2021-10-30 14:07:16'),(24,'password_recovery_tpl_subject','{{website_name}} - Reset Password Notification','email','2021-10-30 14:07:16','2021-10-30 17:21:55'),(25,'password_recovery_tpl','<p>Hi<strong> {{firstname}}</strong>! ,</p><p>You are receiving this email beca